import React from "react";
import axios from "axios";

class FetchStatus extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      currentSlackStatus: "",
      currentSlackEmoji: ""
    };
  }
  componentDidMount() {
    axios.get('https://474d-68-36-121-182.ngrok-free.app/current')
      .then(response => {
        this.setState({
          currentSlackStatus: response.data.slack_text,
          currentSlackEmoji: response.data.slack_emoji
        });
      })
      .catch(error => {
        console.log(error);
      });
  }

  render() {
    return (
      <div>
        <label>{this.state.currentSlackStatus}</label>
        <label>{this.state.currentSlackEmoji}</label>
      </div>
    );
  }
}

export default FetchStatus;
